import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View } from 'react-native';
import LoginScreen from './src/containers/LoginScreen';
import HomeScreen from './src/containers/HomeScreen';
import RoommateViewPostScreen from './src/containers/RoommateViewPostScreen';
import RoomViewPostScreen from './src/containers/RoomViewPostScreen';
import FavouriteScreen from './src/containers/FavouriteScreen';
import ProfileScreen from './src/containers/ProfileScreen';
import Ionicons from 'react-native-vector-icons/Ionicons';



import { NavigationContainer } from '@react-navigation/native';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { createStackNavigator } from '@react-navigation/stack';

const Stack = createStackNavigator();
const Tab = createBottomTabNavigator();


 function HomeStack() {
  return (
      <Stack.Navigator >
        <Stack.Screen  name="HomeScreen" component={HomeScreen} Options={{headerShown: false}}/>
        <Stack.Screen  name="RoommateViewPostScreen" component={RoommateViewPostScreen} Options={{headerShown: false}}/>
        {/* <Stack.Screen  name="LoginScreen" component={LoginScreen} screenOptions={{headerShown: false}}/> */}
        <Stack.Screen  name="FavouriteScreen" component={FavouriteScreen} Options={{headerShown: false}}/>
        <Stack.Screen  name="ProfileScreen" component={ProfileScreen} Options={{headerShown: false}}/>
        <Stack.Screen  name="RoomViewPostScreen" component={RoomViewPostScreen} Options={{headerShown: false}}/>
      </Stack.Navigator>
    
  );
}

export default function App() {
  return (
    <NavigationContainer>
      <Tab.Navigator
        screenOptions={({ route }) => ({ 
          headerShown: false,
          tabBarIcon: ({ focused, color, size }) => {

            let iconName;

            if (route.name === 'Home') {
              iconName = "home"
            } else if (route.name === 'Favourite') {
              iconName = "star"
            } else if (route.name === 'Profile') {
              iconName = "person"
            }
            

            
            // You can return any component that you like here!
            return <Ionicons name={iconName} size={size} color={color} />;
                    
          },
          tabBarActiveTintColor: 'tomato',
          tabBarInactiveTintColor: 'gray',
        })}
      >
        <Tab.Screen name="Home" component={HomeScreen} />
        <Tab.Screen name="Favourite" component={FavouriteScreen} />
        <Tab.Screen name="Profile" component={ProfileScreen} />
      </Tab.Navigator>
    </NavigationContainer>
  );
}
